description:
Join Phoebe, Piper, and Prue as they conjure up some smoldering sex in this magical parody! When Phoebe is kidnapped by demons, Piper and Prue must seek the Ring of Fire to save her! Hidden powers, demons in disguise and lost love all to the power of THREE. Starring Angelina Valentine, Sadie West, and Chayse Evans. Their Coven, their rules! 

Cast:
Alan Stafford, Alec Knight, Angelina Valentine, Chayse Evans, Chris Johnson, Cyrus King, Jenny Hendrix, Marie Luv, Ryder Skye, Sadie West, Tyler Knight 

